import Foundation
func maxVowels(_ s: String, _ k: Int) -> Int {
    let vowel:[Character] = ["a","e","o","u","i"]
    var count = 0
    var x = 0
    let chars = Array(s)
    
    
    for i in 0 ..< k {
        if vowel.contains(chars[i]) {count += 1}
    }
    
    
    var max = count
    
    for i in k ..< chars.count {
        if vowel.contains(chars[i]) {count += 1}
        if vowel.contains(chars[x]) {count -= 1}
        x += 1
        if max < count {max = count}
    }
    
    
    return max
}

maxVowels("", 133)
